import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <>
      <h1>Lead Time</h1>
      <h3>From code pushed to code deployed: 9 minutes</h3>
      <input type="Text" id="leadTimeInput"/> 
      <button id="leadTimeSubmit">Submit</button>
    </>
  );
}

export default App;
